Declare @Periodo INT SET @Periodo = (select MAX(id_periodo) from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA)
/* CES sobre Contactos */
INSERT INTO Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION (Periodo, ces_contactos) select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as ces_contactos from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA where id_indicador_satisfaccion_atencion = 1 and id_periodo = @Periodo group by id_periodo
/* ISC sobre Contactos */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as isc_contactos into #temp_ISC_CONTACTOS from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H ON H.id_periodo = A.Periodo where id_indicador_satisfaccion_atencion = 2 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET isc_contactos = T.isc_contactos from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_ISC_CONTACTOS T ON T.id_periodo = A.Periodo
/* NPS Promotores sobre Contactos */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as nps_promotores_contactos into #temp_NPS_Promotores_Contactos from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H where id_indicador_satisfaccion_atencion = 3 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_promotores_contactos = T.nps_promotores_contactos from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Promotores_Contactos T ON T.id_periodo = A.Periodo
/* NPS Detractores sobre Contactos */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as nps_detractores_contactos into #temp_NPS_Detractores_Contactos from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H where id_indicador_satisfaccion_atencion = 4 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_detractores_contactos = T.nps_detractores_contactos from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Detractores_Contactos T ON T.id_periodo = A.Periodo
/* NPS sobre Contactos */
select Periodo ,SUM(nps_promotores_contactos-nps_detractores_contactos) * 100 as nps_contactos into #temp_NPS_Contactos from consultas_dw.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION where Periodo = @Periodo group by Periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_contactos = T.nps_contactos from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Contactos T ON T.Periodo = A.Periodo
/* ISC sobre Stock */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as isc_stock into #temp_ISC_Stock from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H ON H.id_periodo = A.Periodo where id_indicador_satisfaccion_atencion = 5 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET isc_stock = T.isc_stock from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_ISC_Stock T ON T.id_periodo = A.Periodo
/* NPS Promotores sobre Stock */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as nps_promotores_Stock into #temp_NPS_Promotores_Stock from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H where id_indicador_satisfaccion_atencion = 6 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_promotores_Stock = T.nps_promotores_Stock from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Promotores_Stock T ON T.id_periodo = A.Periodo
/* NPS Detractores sobre Stock */
select id_periodo , CAST(sum(numerador) AS FLOAT)/CAST(sum(denominador) AS FLOAT) as nps_detractores_Stock into #temp_NPS_Detractores_Stock from H_INDICADORES_SATISFACCION_ATENCION_COMPANIA H where id_indicador_satisfaccion_atencion = 7 and id_periodo = @Periodo group by id_periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_detractores_Stock = T.nps_detractores_Stock from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Detractores_Stock T ON T.id_periodo = A.Periodo
/* NPS sobre Stock */
select Periodo , SUM(nps_promotores_Stock-nps_detractores_Stock) * 100 as nps_Stock into #temp_NPS_Stock from consultas_dw.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION where Periodo = @Periodo group by Periodo
UPDATE Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION SET nps_Stock = T.nps_Stock from Consultas_DW.dbo.AUX_H_INDICADORES_SATISFACCION_ATENCION A Inner join #temp_NPS_Stock T ON T.Periodo = A.Periodo
